import React from 'react'
import { Link, useNavigate, useLocation } from 'react-router-dom'
const Note = ({ note }) => {
  const location = useLocation()
  const { _id, title, body } = note
  const navigate = useNavigate()
  const onNoteClick = (id) => {
    console.log(id);
    // <Link to={`/${id}`} />
    console.log(<Link/>);
    // navigate(`/api/dashboard/notes/${id}`)
    navigate(`http://localhost:3000/api/dashboard/notes/${id}`)
  }
  return (
    <div className='note-container' onClick={(e) => onNoteClick(_id)}>
      Title: {title}
      Body: {body}
    </div>
  )
}

export default Note
